  `dept` varchar(50) DEFAULT NULL,
  `division` varchar(50) DEFAULT NULL,
  `stip_fund` varchar(6) DEFAULT NULL,
  `indx` varchar(7) DEFAULT NULL,
  `fund` varchar(6) DEFAULT NULL,
  `org` varchar(6) DEFAULT NULL,
  `acct` varchar(6) DEFAULT NULL,
  `notes` varchar(255) DEFAULT NULL,
  `status` bit(1) NOT NULL DEFAULT b'1',
  `date_created` datetime DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `date_modified` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `modified_by` int(11) DEFAULT NULL,
  PRIMARY KEY (`stipdept_id`),
  KEY `idx_index` (`indx`),
  KEY `idx_dept` (`dept`),
  KEY `idx_fund` (`fund`),
  KEY `idx_stip_fund` (`stip_fund`)
) ENGINE=InnoDB AUTO_INCREMENT=757 DEFAULT CHARSET=latin1;
